textOriginal:
Agora o Brasil pode voltar para a normalidade. 
Zambelli precisa voltar o quanto antes para o esgoto, ser desarmada e julgada;
Pazuello é bandido, dificultou a vacinação, negacionista e inspirou bolsonaristas abilolados, precisa ser julgado;
O antigo Ministro da Educação, o presidiário Milton Ribeiro, tem porte de arma e a arma, algum tempo atrás, disparou sozinha no aeroporto;
Roberto Jeferson armado dando tiro na PF;
Familícia com intima relação com tráfico e armas;
O líder da quadrilha, Bolsonaro, será desmascarado com os 100 anos de sigilo revelado;

De fato não houve imparcialidade nas eleições devido a:
1- Grande mídia claramente do lado do ladrão;
2- TSE e STF parciais ao PT;
3- Fakenews das propagandas do PT como, canibalismo, pedófila, diminuição do salário mínimo, etc;
4- Disparidade nas incersoes em rádios do nordeste;
5- Censura de mídias com viés de direita como Brasil Paralela e Jovem Pan;
6- Casos de compra de votos pelo Brasil;
7- Voto por coação em comunidades comandadas pelo crime;
8- Casos de gente que ia votar e já tinham votado por ela;
9- E possível adulteração de urnas já que as mesmas são "inalditaveis"; 
10- Pesquisas eleitorais tendenciosas ao partido do PT;

Vocês acham que houve democracia nessas eleições? É óbvio que não.
